/**
 * @param {string} s
 * @param {string} t
 * @return {string}
 */
var minWindow = function (s, t) {
  s = "ADOBECODEBANC";
  t = "ABC";
  //   s = "bdab";
  //   t = "ab";
  //   s =
  //     "";
  //   t =
  //     "";
  let charHash = {};

  for (let i = 0; i < t.length; i++) {
    if (!charHash[t[i]]) {
      charHash[t[i]] = 1;
    } else {
      charHash[t[i]]++;
    }
  }
  let stringCopy = s;
  let minLen = 2 ** 31;
  let result = {};
  let startP = 0;
  let endP = t.length - 1;
  let start = -1;
  while (startP < s.length) {
    let copyHash = { ...charHash };
    for (let i = startP; i < endP; i++) {
      if (copyHash[stringCopy[i]] != undefined) {
        if (start == -1) {
          start = i;
        }
        copyHash[stringCopy[i]]--;
        if (copyHash[stringCopy[i]] == 0) {
          delete copyHash[stringCopy[i]];
        }
        if (Object.keys(copyHash).length == 0) {
          copyHash = { ...charHash };
          if (i - start > -1) {
            let len = i - start + 1;
            let newString = stringCopy.slice(start, i + 1);
            if (newString.length >= t.length) {
              result[len] = stringCopy.slice(start, i + 1);
              minLen = Math.min(minLen, len);
            }
            start = -1;
            startP++;
          }
        }
      }
    }
    if (
      (Object.keys(result).length == 0 || endP - startP >= t.length - 1) &&
      endP < s.length
    ) {
      endP++;
    } else {
      startP++;
    }
  }
  return result[minLen];
  // while (stringCopy.length >= t.length) {
  //     let copyHash = { ...charHash };
  //     let start = -1;
  //     for (let i = 0; i < stringCopy.length; i++) {
  //       if (copyHash[stringCopy[i]] != undefined) {
  //         if (start == -1) {
  //           start = i;
  //         }
  //         copyHash[stringCopy[i]]--;
  //         if (copyHash[stringCopy[i]] == 0) {
  //           delete copyHash[stringCopy[i]];
  //         }
  //         if (Object.keys(copyHash).length == 0) {
  //           copyHash = { ...charHash };
  //           let len = i - start + 1;
  //           result[len] = stringCopy.slice(start, i + 1);
  //           minLen = Math.min(minLen, len);

  //           start = -1;
  //         }
  //       }
  //     }
  //     stringCopy = stringCopy.slice(1);
};
